import React, { useEffect, useState } from "react"
import { useHistory } from "react-router-dom"

const Home = () => {
  const history = useHistory()
  const [user, setUser] = useState(null)
  useEffect(() => {
    !user && history.push("/login")
  }, [])
  return <div>HomePage</div>
}

export default Home
